import {useParams, useNavigate} from 'react-router-dom'

const Details = () => {

  const { id } = useParams()
  const navigate = useNavigate()

  const remove = () => {
    fetch('http://localhost:8080/api/blogs/' + id, {
      method: 'DELETE'
    })
    .then(() => {
      navigate('/')
    })
  }

  return (
    <div>
      <h1>this detail</h1>
    </div>
  )
}

export default Details
